import SHOP_DATA from './shop.data';
import shopActionTypes from './shop.types';

const INITIAL_STATE = {
    collections: SHOP_DATA
}

const collectionsReducer = (state = INITIAL_STATE, action) => {
    switch (action.type) {
        default:
            return state;
    }

    switch (action.type) {
        default:
            return state;
    }
}

export default collectionsReducer;
